import React, { useState } from 'react';
import {
  Container,
  Typography,
  Button,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
  TextField,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from '@mui/material';
import { makeStyles } from '@mui/styles';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import AddIcon from '@mui/icons-material/Add';
import mockServices from '../data/mockServices'; // Asumiendo que tienes un archivo mockServices.js con los servicios mockeados

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
  button: {
    margin: theme.spacing(1),
  },
  list: {
    width: '100%',
    backgroundColor: theme.palette.background.paper,
  },
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
    width: '100%',
  },
}));

function MyServices() {
  const classes = useStyles();
  const [services, setServices] = useState(mockServices);
  const [currentService, setCurrentService] = useState(null);
  const [dialogOpen, setDialogOpen] = useState(false);
  const [formData, setFormData] = useState({
    serviceName: '',
    serviceCategory: '',
    serviceType: '',
    duration: '',
    frequency: '',
    cost: '',
  });
  const [errorMessage, setErrorMessage] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({ ...prevData, [name]: value }));
  };

  const handleSave = () => {
    if (Object.values(formData).some((value) => !value)) {
      setErrorMessage('Por favor, completa todos los campos del formulario.');
      return;
    }

    const newService = {
      id: Date.now(),
      ...formData,
    };

    if (currentService) {
      setServices((prevServices) =>
        prevServices.map((service) =>
          service.id === currentService.id ? newService : service
        )
      );
    } else {
      setServices((prevServices) => [...prevServices, newService]);
    }

    setDialogOpen(false);
    setFormData({
      serviceName: '',
      serviceCategory: '',
      serviceType: '',
      duration: '',
      frequency: '',
      cost: '',
    });
  };

  return (
    <Container className={classes.root}>
      <Typography variant="h4" gutterBottom>
        Mis Servicios
      </Typography>
      <Button
        variant="contained"
        color="primary"
        startIcon={<AddIcon />}
        onClick={() => setDialogOpen(true)}
      >
        Agregar Servicio
      </Button>
      <List className={classes.list}>
        {services.map((service) => (
          <ListItem key={service.id}>
            <ListItemText
              primary={service.serviceName}
              secondary={`Duración: ${service.duracion} — Costo: ${service.costo}`}
            />
            <ListItemSecondaryAction>
              <IconButton
                edge="end"
                aria-label="edit"
                onClick={() => {
                  setCurrentService(service);
                  setFormData({
                    serviceName: service.nombre,
                    serviceCategory: service.categoria,
                    serviceType: service.tipo,
                    duration: service.duracion,
                    frequency: service.frecuencia,
                    cost: service.costo,
                  });
                  setDialogOpen(true);
                }}
              >
                <EditIcon />
              </IconButton>
              <IconButton
                edge="end"
                aria-label="delete"
                onClick={() =>
                  setServices((prevServices) =>
                    prevServices.filter((s) => s.id !== service.id)
                  )
                }
              >
                <DeleteIcon />
              </IconButton>
            </ListItemSecondaryAction>
          </ListItem>
        ))}
      </List>
      <Dialog open={dialogOpen} onClose={() => setDialogOpen(false)}>
        <DialogTitle>
          {currentService ? 'Modificar Servicio' : 'Agregar Servicio'}
        </DialogTitle>
        <DialogContent>
          <TextField
            fullWidth
            margin="normal"
            label="Nombre"
            name="serviceName"
            value={formData.serviceName}
            onChange={handleInputChange}
          />
          <FormControl className={classes.formControl}>
            <InputLabel>Categoría</InputLabel>
            <Select
              name="serviceCategory"
              value={formData.serviceCategory}
              onChange={handleInputChange}
            >
              <MenuItem value="tutorias">Tutorías escolares</MenuItem>
              <MenuItem value="idioma">Clases de idioma</MenuItem>
            </Select>
          </FormControl>
          <FormControl className={classes.formControl}>
            <InputLabel>Tipo de clase</InputLabel>
            <Select
              name="serviceType"
              value={formData.serviceType}
              onChange={handleInputChange}
            >
              <MenuItem value="individual">Individual</MenuItem>
              <MenuItem value="grupal">Grupal</MenuItem>
            </Select>
          </FormControl>
          <TextField
            fullWidth
            margin="normal"
            label="Duración (En Semanas)"
            name="duration"
            value={formData.duration}
            onChange={handleInputChange}
          />
          <FormControl className={classes.formControl}>
            <InputLabel>Frecuencia</InputLabel>
            <Select
              name="frequency"
              value={formData.frequency}
              onChange={handleInputChange}
            >
              <MenuItem value="única">Única</MenuItem>
              <MenuItem value="semanal">Semanal</MenuItem>
              <MenuItem value="mensual">Mensual</MenuItem>
            </Select>
          </FormControl>
          <TextField
            fullWidth
            margin="normal"
            label="Costo"
            name="cost"
            value={formData.cost}
            onChange={handleInputChange}
          />
          {errorMessage && (
            <Typography color="error">{errorMessage}</Typography>
          )}
        </DialogContent>
        <DialogActions>
          <Button
            onClick={() => {
              setDialogOpen(false);
              setCurrentService(null);
              setErrorMessage('');
            }}
            color="primary"
          >
            Cancelar
          </Button>
          <Button onClick={handleSave} color="primary">
            Guardar
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
}

export default MyServices;
